(1, 35, 'Potrfolio EB creation', 'potrfolio-eb-creation', '', '<p>Moje portfolio</p>', '', -2, 0, 0, 2, '0000-00-00 00:00:00', 0, '', '2013-01-27 18:26:13', 221, 0, '0000-00-00 00:00:00', '2013-01-27 18:26:13', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 2, 0, 1, '', '', 1, 6, '{"robots":"","author":"","rights":"","xreference":""}', 1, '*', ''),
(2, 37, 'Oferta', 'oferta', '', '<p><strong>Nowoczesna</strong> oferta dla <strong>firm</strong> i <strong>klientów indywidualnych</strong>:</p>\r\n<p>Strony internetowe</p>\r\n<p>W swoich projektach kładę nacisk na <strong>estetykę</strong> i <strong>prostotę</strong>. Tworzę strony internetowe w oparciu o CMS Joomla. Choć wykonanie strony w tej technologii jest bardziej czasochłonne, to jest to rozwiązanie <strong>korzystniejsze dla klienta</strong>, niż w przypadku zwykłej strony, ponieważ dzięki <strong>specjalnemu systemowi </strong>będzie on mógł sam, <strong>w prosty sposób administrować</strong> swoją stroną, dodawać nowe treści, bez konieczności ponoszenia dodatkowych opłat. &nbsp;W przeciwieństwie do wielu innych „webmasterów”, nie instaluję gotowych &nbsp;szablonów, ale <strong>zawsze </strong>tworzę <strong>indywidualny projekt graficzny</strong> strony, w oparciu o przesłane przez Państwa wytyczne. &nbsp;Z wykonanymi przeze mnie projektami mogą się Państwo zapoznać w zakładce Strony internetowe. Klienci chwalą sobie <strong>dopracowaną warstwę graficzną</strong> stron oraz ich <strong>czytelność</strong>. Gwarantuję, że będą Państwo zadowoleni!</p>\r\n<p>Identyfikacja wizualna</p>\r\n<p>Państwa firmie brakuje logo? A może logo, które macie, przydałoby się odświeżyć? Chętnie pomogę w każdym przypadku! Wykonam dla Państwa <strong>nowoczesne </strong>i <strong>eleganckie </strong>logo, w oparciu o profil państwa działalności. Nie ma mowy o żadnych powtarzających się szablonach, projekt jest zawsze <strong>indywidualny. </strong>Loga tworzę <strong>w technologii wektorowej</strong>, która umożliwi państwu ich powiększenie <strong>do dowolnych rozmiarów</strong> i użycie na dowolnym nośniku, czy to na <strong>stronie internetowej</strong>, na <strong>wizytówce</strong>, nawet na wielkich <strong>reklamach</strong>, wszędzie, gdzie zajdzie potrzeba! Zapraszam do zapoznania się z już wykonanymi przeze mnie projektami w zakładce Identyfikacja wizualna.</p>\r\n<p>Ulotki i plakaty</p>\r\n<p>Świadczę usługi w zakresie tworzenia reklam, typu <strong>ulotka</strong>, <strong>ogłoszenie</strong>, <strong>plakat</strong> w formatach <strong>drukowanym</strong> i <strong>elektronicznym</strong>. Jeżeli chcą się państwo w ten sposób zareklamować, a potrzebujecie ubrać taką reklamę w warstwę wizualną, ta oferta jest dla Państwa! Oferuję <strong>nowoczesną grafikę reklamową</strong>, nowe spojrzenie na znane już formy reklamowe. Zapraszam do zapoznania się z wykonanymi przeze mnie reklamami w zakładce Ulotki i plakaty.</p>\r\n<p>Grafika produktowa</p>\r\n<p>Potrzebujecie państwo w <strong>profesjonalny</strong> i <strong>nowoczesny</strong> sposób wykonanej reklamy produktu lub usługi? Wszystko, co Państwo już widzieliście, zdaje się być jednakowe i nieciekawe? Mam Państwu do zaoferowania alternatywne rozwiazanie! <strong>Nowoczesna grafika reklamowa</strong> sprawdzi się zarówno w mediach elektronicznych jak i drukowanych. Zapraszam do zapoznania się z przykładowymi grafikami w zakładce Grafika produktowa.</p>\r\n<p>Obróbka graficzna zdjęć</p>\r\n<p>Posiadacie Państwo zdjęcia, ale pragniecie nadać im <strong>profesjonalny wygląd</strong>? A może coś na zdjęciach jest nie tak i potrzebują one małej <strong>korekty</strong>? Oferuję pełen wachlarz obróbek graficznych zdjęć, zarówno <strong>dla fotografów</strong>, jak i <strong>firm</strong> i <strong>osób prywatnych</strong>, którzy pragną, by ich zdjęcia stały się <strong>spektakularne</strong> i <strong>bez skazy</strong>. Zapraszam do oglądnięcia <strong>w pełni obrobionych zdjęć </strong>w zakładce Obróbka graficzna zdjęć.</p>\r\n<p>Grafika artystyczna</p>\r\n<p>A może coś zupełnie innego? Artystyczne podejście do reklamy? Albo po prostu sztuka!</p>\r\n<p>&nbsp;</p>', '', 0, 0, 0, 8, '2013-01-27 21:41:09', 221, '', '2013-04-20 11:47:25', 221, 0, '0000-00-00 00:00:00', '2013-01-27 21:41:09', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_in