(7, 48, 'Dynamiczne strony internetowe', 'dynamiczne-strony-internetowe', '', '<p>{gallery}strony{/gallery}</p>\r\n<p>&nbsp;</p>\r\n<p>W swoich projektach kładę nacisk na estetykę i prostotę. Tworzę dynamiczne strony internetowe w oparciu o system zarządzania treścią - CMS Joomla. Sprawnie wdrażanie w tym systemie najróżniejszych elementów nie stanowi dla mnie problemu. Swobodnie poruszam się w tym środowisku.</p>\r\n<p>(Wygląd zaprezentowanych stron jest stanem w dniu oddania ich danemu klientowi. Od tego czasu klient mógł sam wprowadzić zmiany na stronie i zmienić jej wygląd).</p>', '', 1, 0, 0, 13, '2013-03-24 14:23:33', 221, '', '2014-01-27 12:01:08', 221, 221, '2014-01-27 12:01:08', '2013-03-24 14:23:33', '0000-00-00 00:00:00', '{"image_intro":"images\\/web.png","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 20, 0, 0, 'tworzenie stron internetowych, tworzenie stron, tworzenie stron www, projektowanie stron internetowych, projektowanie stron, projektowanie stron www, projekt strony, projekt strony www, projekt strony internetowej, webdesign, web design, webmaster', 'tworzenie stron internetowych, tworzenie stron, tworzenie stron www, projektowanie stron internetowych, projektowanie stron