(8, 50, 'EBcreation', 'home', '', '<p style="text-align: center;">&nbsp;<span style="text-align: center; line-height: 1.3em;">Witam serdecznie na mojej stronie!</span></p>\r\n<p>Na co dzień zajmuję się tworzeniem stron internetowych oraz projektowaniem wszelkiego rodzaju grafik komputerowych. Chętnie działam na technologiach takich jak HTML5 i CSS3 z małą domieszką Javascript i JQuery. Również sprawnie operuję tworząc dynamiczne strony internetowe z systemem zarządzania treścią, oparte na CMS Joomla. Od ponad roku funkcjonuję w fazie nieustannego doskonalenia w zakresie tworzenia stron WWW, zarówno od strony technicznej i kodowania, jak i w warstwie użytkowej i graficznej. Zapraszam do zapoznania się z moim portfolio.&nbsp;</p>\r\n<p style="text-align: right;">Emilia Basara&nbsp;</p>', '', 1, 0, 0, 14, '2013-03-24 14:53:07', 221, '', '2014-01-09 00:10:27', 221, 0, '0000-00-00 00:00:00', '2013-03-24 14:53:07', '0000-00-00 00:00:00', '{"image_intro":"images\\/home.png","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"0","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 18, 0, 0, 'ebcreation, tworzenie stron internetowych, tworzenie stron, tworzenie stron www, projektowanie stron internetowych, projektowanie stron, projektowanie stron www, projekt