(9, 51, 'Ciasteczka', 'ciasteczka', '', '<p>Szanujemy prywatność naszych użytkowników i chcemy, aby korzystając z naszych witryn czuli się bezpiecznie. Poniżej przedstawiamy fragment naszej Polityki prywatności odnoszący się do tzw. plików Cookies.</p>\r\n<p>Kiedy wchodzisz na strony naszych witryn, na dysku Twojego komputera mogą być zapisywane tzw. ciasteczka (ang. cookies), czyli niewielkie pliki tekstowe wysyłane przez nasz serwer albo serwer Google.<br />Z naszego serwera wysyłamy pliki ciasteczek wyjątkowo. Służą one zapamiętaniu preferowanego wyglądu stron, ustawionego przez użytkowników, np. rozmiaru czcionki, odnotowaniu faktu głosowania w prowadzonych ankietach albo wykonaniu przez użytkownika kilkuetapowych czynności (np. dodania artykułu, dokonania zakupu w naszym sklepie internetowym). Korzystamy również z ciasteczek służących dopasowaniu wyświetlanych reklam do zainteresowań odwiedzających witryny.<br />Zapisywanych na Twoim komputerze informacji wysyłanych z naszego serwera nigdzie nie gromadzimy i w żaden sposób nie przetwarzamy.<br />Oprócz ciasteczek wysyłanych z naszego serwera za pośrednictwem naszych witryn wysyłane są cookies firmy Google, które służą dopasowaniu reklam wyświetlanych w modułach Google do Twoich zainteresowań.<br />W każdym momencie możesz wyłączyć możliwość zapisywania wszystkich lub niektórych ciasteczek poprzez zmianę ustawień w swojej przeglądarce internetowej.<br />Jeżeli zdecydujesz się na odrzucenie wszystkich ciasteczek, nie będzie możliwe korzystanie z niektórych treści treści i usług udostępnianych w naszych witrynach, w szczególności wymagających logowania. Wyłączenie ciasteczek nie powoduje natomiast braku możliwości przeglądania stron w naszych witrynach.<br /><br/>JAK WYŁĄCZYĆ CIASTECZKA:</p>\r\n<p><a href="http://help.opera.com/Windows/12.10/pl/cookies.html" title="w przeglądarce Opera" target="_blank">w przeglądarce Opera</a><br /><a href="http://support.mozilla.org/pl/kb/W%C5%82%C4%85czanie%20i%20wy%C5%82%C4%85czanie%20obs%C5%82ugi%20ciasteczek" title="w przegladarce Firefox" target="_blank">w przegladarce Firefox</a><br /><a href="http://support.google.com/chrome/bin/answer.py?hl=pl&amp;answer=95647" title="w przeglądarce Chrome" target="_blank">w przeglądarce Chrome</a><br /><a href="http://windows.microsoft.com/pl-pl/windows7/block-enable-or-allow-cookies" title="w przeglądarce Internet Explorer" target="_blank">w przeglądarce Internet Explorer</a><br /><a href="http://support.apple.com/kb/PH5042" title="w przeglądarce Safarii" target="_blank">w przeglądarce Safarii</a><br /><br/>Jeśli korzystasz z urządzenia przenośnego (telefon, smartfon, tablet), zapoznaj się z opcjami dotyczącymi ochrony prywatności w dokumentacji na stronie internetowej producenta Twojego urządzenia.</p>', '', 1, 0, 0, 2, '2013-04-15 12:57:22', 221, '', '2014-01-08 23:28:23', 221, 0, '0000-00-00 00:00:00', '2013-04-15 12:57:22', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"0","show_category":"0","link_category":"0","show_parent_category":"0","link_parent_category":"0","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 2, 0, 1, '', '', 1, 579, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
