(14, 64, 'Strony internetowe statyczne', 'strony-internetowe-statyczne', '', '<p>{gallery}statyczne{/gallery}</p>\r\n<p>&nbsp;</p>\r\n<p>W kodowaniu stron internetowych posługuję się najnowszymi technologiami - HTML5 i CSS3. Potrafię stosować zagadnienia wyglądu responsywnego, czyli tzw. Responsive Web Design (dopasowującego się do rodzaju urządzenia, na którym strona jest oglądana). Tworzę uniwersalny kod, działający na różnych przeglądarkach. Projektuję strony proste i funkcjonalne, nie obciążone nadmiarem bodźców wizualnych.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', '', 1, 0, 0, 19, '2013-12-21 14:09:30', 221, '', '2014-01-09 01:15:32', 221, 0, '0000-00-00 00:00:00', '2013-12-21 14:09:30', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 7, 0, 0, '', '', 1, 142, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', '');
