(10002, 'TinyMCE pl-PL', 'file', 'TinyMCE_pl-PL', '', 0, 1, 0, 0, '{"legacy":false,"name":"TinyMCE pl-PL","type":"file","creationDate":"20 czerwca 2012","author":"Polskie Centrum Joomla!","copyright":"(C) 2010-2012 Polskie Centrum Joomla!","authorEmail":"zwiastun@joomla.pl","authorUrl":"http:\\/\\/www.joomla.pl","version":"3.5.2","description":"\\n\\t\\t<h2>Gratulujemy pomy\\u015blnej instalacji pakietu j\\u0119zykowego edytora TinyMCE 3.5.2 w Joomla 2.5<\\/h2>\\n\\t\\tJe\\u015bli u\\u017cywasz innych j\\u0119zyk\\u00f3w ni\\u017c angielski i polski, pami\\u0119taj, aby zainstalowa\\u0107 wszystkie pakiety j\\u0119zykowe, zanim w konfiguracji TinyMCE ustawisz na ''Tak'' opcj\\u0119 ''Automatyczny wyb\\u00f3r j\\u0119zyka''.<br\\/>Aby korzysta\\u0107 z t\\u0142umacze\\u0144 edytora TinyMCE:\\n\\t\\t<ol>\\n\\t\\t<li>Wybierz z menu zaplecza Rozszerzenia &rart; Dodatki<\\/li>\\n\\t\\t<li>Odszukaj <a href=\\"index.php?option=com_plugins&view=plugins&filter_search=Edytor - TinyMCE\\">Edytor - TinyMCE<\\/a><\\/li>\\n\\t\\t<li>Przejd\\u017a do sekcji Opcje podstawowe<\\/li>\\n\\t\\t<li>Tryb pracy :: Rozszerzony (opcjonalnie -- je\\u015bli chcesz korzysta\\u0107 z pe\\u0142nej funkcjonalno\\u015bci TinyMCE)<\\/li>\\n\\t\\t<li>Ustaw Automatyczny wyb\\u00f3r j\\u0119zyka :: Tak<\\/li>\\n\\t\\t<\\/ol>\\n\\t\\t<p><\\/p>\\n\\t\\t<p>Zauwa\\u017cone usterki i b\\u0142\\u0119dy prosimy zg\\u0142asza\\u0107 na forum polskiej spo\\u0142eczno\\u015bci Joomla! w dziale <a href=\\"http:\\/\\/forum.joomla.pl\\/forumdisplay.php?35-T%C5%82umaczenia\\" target=\\"_blank\\">T\\u0142umaczenia<\\/a><\\/p>\\n\\n\\t\\t\\n\\t","group":""}', '', '', '', 0, '0000-00-00 00:00:00', 0, 0),
(10003, 'pl-PL', 'package', 'pkg_pl-PL', '', 0, 1, 1, 0, '{"legacy":false,"name":"Polish Language Pack","type":"package","creationDate":"7 listopada 2012","author":"Polski Zesp\\u00f3\\u0142 T\\u0142umaczy","copyright":"Copyright (C) 2005 - 2012 joomla.pl and Open Source Matters. All right reserved.","authorEmail":"zwiastun@joomla.pl","authorUrl":"www.joomla.pl","version":"2.5.8.1","description":"\\n    \\n    <h3>Kompletny pakiet j\\u0119zyka polskiego dla Joomla! pl-PL wersja 2.5.8.1<\\/h3>\\n    <div style=\\"font-weight: normal\\">\\n\\t<p>Zainstalowano lub uaktualniono:<\\/p>\\n\\t\\t<ul>\\n\\t\\t\\t<li>pliki j\\u0119zyka polskiego witryny dla Joomla 2.5.8<\\/li>\\n\\t\\t\\t<li>pliki j\\u0119zyka polskiego zaplecza dla Joomla 2.5.8<\\/li>\\n\\t\\t\\t<li>pliki j\\u0119zyka polskiego dla edytora TinyMCE 3.5.2<\\/li>\\n\\t\\t<\\/ul><\\/div>\\n\\t\\t<h3>Je\\u015bli jest to Twoja pierwsza instalacja j\\u0119zyka polskiego w tym Joomla!:<\\/h3>\\n\\t\\t<div style=\\"font-weight: normal\\"><ul>\\n\\t\\t\\t<li>przejd\\u017a na stron\\u0119 <a href=\\"index.php?option=com_languages\\">Extensions\\/Language Manager<\\/a> i ustaw j\\u0119zyk polski jako domy\\u015blny j\\u0119zyk witryny (na karcie <i>Installed Site<\\/i>) oraz jako domy\\u015blny j\\u0119zyk zaplecza (na karcie <i>Installed - Administrator<\\/i>, <\\/li>\\n\\t\\t\\t<li>przejd\\u017a na stron\\u0119 <a href=\\"index.php?option=com_plugins&amp;view=plugins&amp;filter_search=TinyMCE\\">dodatku ''Edytor - TinyMCE''<\\/a> i ustaw parametr Kod j\\u0119zyka (''Kod j\\u0119zyka'' = pl) albo ustaw ''Automatyczne wykrywanie j\\u0119zyka'' na ''Tak'' pod warunkiem, \\u017ce masz zainstalowane pakiety j\\u0119zykowe TinyMCE wszystkich j\\u0119zyk\\u00f3w u\\u017cywanych w Joomla!<\\/li>\\n\\t\\t<\\/ul>\\t<\\/div>  \\n\\t\\n   ","group":""}', '{}', '', '', 0, '0000-00-00 00:00:00', 0, 0),
