tact \\n\\tforms, forum, guestbook and lots more.  If you are familiar with Joomla, then you''ll love this.  It takes just minutes to setup and is ready to go! <a href=\\"http:\\/\\/www.guidedhelp.net\\/joomlacentral\\">Download it for free<\\/a> today.<\\/p>\\n\\t<h2>FREE WEBSITE DESIGNER KIT<\\/h2>\\n\\t<p>Like the idea of being able to design and build your own Joomla templates, but no experience with coding or lack the technical skills?\\n\\tIn that case why not download our free <a href=\\"http:\\/\\/www.guidedhelp.net\\/joomlacentral\\">Website Designer Kit<\\/a> for Joomla and start designing your own Joomla templates today.  The Website Designer Kit is a free Joomla template that has over 4000 easy to use \\n\\tparameters allowing you to easily create your own Joomla templates!  No technical skills required - just download, install and customize to your needs!<\\/p>\\n\\t<a href=\\"http:\\/\\/www.guidedhelp.net\\/joomlacentral\\">Download today<\\/a> it''s free!\\n\\t<p>Visit GuidedHelp.net for lots of free Joomla templates, guides and tutorials and much more.  Everything you need to know about Joomla.<\\/p>\\n\\t<HR>\\n\\t<h3>Changelog<\\/h3>\\n\\t<b>3.0<\\/b><br \\/>\\n\\t<ul>\\n\\t<li>Added CSS drop down menu<\\/li>\\n\\t<li>Made more compliant with standard Joomla module positions<\\/li>\\n\\t<li>Added additional module positions<\\/li>\\n\\t<li>Integrated better font from Google Fonts for better visual appearance<\\/li>\\n\\t<li>Fixed some bugs<\\/li>\\n\\t<\\/ul>\\n\\t<b>2.0<\\/b><br \\/>\\n\\t<ul>\\n\\t<li>Initial Release from <a href=\\"http:\\/\\/www.GuidedHelp.net\\">GuidedHelp.net<\\/a>  -  Drastically re-developed based loosely on Yagendoo City Sky. Completely Redesigned.<\\/li>\\n\\t<\\/ul>\\n\\t<b>1.0<\\/b><br \\/>\\n\\t<ul>\\n\\t<li>Initial Release from Yagendoo titled ''City Sky'' - a fine template in its own right. <br>Visit <a href=\\"http:\\/\\/www.yagendoo.com\\">Yagendoo<\\/a> for City Sky or other fine Joomla stuff.<\\/li>\\n\\t<\\/ul>\